Mit LoL habe ich angefangen als es Jinx gab. {{champion:222}} 
Seit dem &#039;suchte&#039; ich viel und gerne. Ich m&uuml;sste an die 100-ranked-Spiele haben (Elo: Silber III). {{summoner:31}} 
Ich studiere zurzeit und habe aufgrund dessen nur nachmittags bzw. abends Zeit zum Zocken.
Ich bin 24, weiblich und spiele am liebsten AP-ler, vorzugsweise Supporter (Main).
Zu Anfang spielte ich ADC&#039;s, seit Langem jedoch bin auf die Support-Rolle gewechselt.
Ich spiele aber auch ab und zu in der Mitte.
Ich bin kritikf&auml;hig, freundlich und gelassen und versuche es selbst bei geflame zu bleiben. ;)

Main Champions derzeit sind: 
- Morgana {{champion:25}} 
- Lux {{champion:99}} 
- Janna {{champion:40}} 

Was ich nicht so gern spiele:
- Tanky-Supps wie: Taric, Braum, Alistar,... {{champion:44}} {{champion:201}} {{champion:12}} 
- Jglr und Top.

Wenn ihr interessiert seit, k&ouml;nnt ihr mich gerne adden.
TS + Server vorhanden.

Freue mich neue Teammates kennenzulernen,
momohimekuro
{{champion:103}}
